DROP TABLE IF EXISTS categories;

CREATE TABLE categories (
    category_id	INT PRIMARY KEY NOT NULL,
    category_name	VARCHAR(512)
);


DROP TABLE IF EXISTS customers;

CREATE TABLE customers (
    customer_id	INT PRIMARY KEY NOT NULL,
    first_name	VARCHAR(512),
    last_name	VARCHAR(512),
    email	VARCHAR(512),
    phone_number	VARCHAR(512),
    address	VARCHAR(512),
    city	VARCHAR(512),
    state	VARCHAR(512),
    zip_code	INT,
    registration_date	DATE
);



DROP TABLE IF EXISTS orderDetails;

CREATE TABLE orderDetails (
    order_detail_id	INT PRIMARY KEY NOT NULL,
    order_id	INT,
    product_id	INT,
    quantity	INT,
    price	FLOAT
);


DROP TABLE IF EXISTS orders;

CREATE TABLE orders (
    order_id	INT PRIMARY KEY NOT NULL,
    customer_id	INT,
    date	DATE,
    total_amount	FLOAT,
    payment_method	VARCHAR(512),
    shipping_address	VARCHAR(512),
    status	VARCHAR(512)
);



DROP TABLE IF EXISTS payments;

CREATE TABLE payments (
    payment_id	INT PRIMARY KEY NOT NULL,
    order_id	INT,
    payment_date	DATE,
    amount	FLOAT,
    payment_method	VARCHAR(512)
);


DROP TABLE IF EXISTS products;

CREATE TABLE products (
    product_id INT PRIMARY KEY NOT NULL,
    product_name VARCHAR(512),
    category_id	INT,
    vendor_id INT,
    price FLOAT,
    stock_quantity INT
);


DROP TABLE IF EXISTS shipments;

CREATE TABLE shipments (
    shipping_id	INT PRIMARY KEY NOT NULL,
    order_id INT,
    shipping_date	VARCHAR(512),
    shipping_method	VARCHAR(512),
    tracking_number	VARCHAR(512),
    status	VARCHAR(512)
);


DROP TABLE IF EXISTS shipments;

CREATE TABLE shipments (
    vendor_id	INT,
    vendor_name	VARCHAR(512),
    contact_name	VARCHAR(512),
    phone_number	VARCHAR(512),
    address	VARCHAR(512),
    city	VARCHAR(512),
    state	VARCHAR(512)
);



DROP TABLE IF EXISTS vendors;

CREATE TABLE vendors (
    vendor_id	INT PRIMARY KEY NOT NULL,
    vendor_name	VARCHAR(512),
    contact_name	VARCHAR(512),
    phone_number	VARCHAR(512),
    address	VARCHAR(512),
    city	VARCHAR(512),
    state	VARCHAR(512)
);


DROP TABLE IF EXISTS shipments;

CREATE TABLE shipments (
    shipping_id	INT,
    order_id	INT,
    shipping_date	DATE,
    shipping_method	VARCHAR(512),
    tracking_number	VARCHAR(512),
    status	VARCHAR(512)
);

